window.bookSummaryJSON = "<p>Tyr is free at last! But for how long? </p> <p>The city-state of Tyr has been freed from a thousand years of slavery to the sorcerer-king, but with change comes chaos and Tyr's triumph may be its death-knell. </p> <p>Almost 20 years after Troy Denning first gave readers a taste of the Dark Sun world, it remains one of the most sought-after settings in the Dungeons and Dragons universe.</p>"; 
